Text:
@Horic88 I'm 15 minutes into it and I can definitely confirm what @HHHarper said about the audio, as for video, there's nothing wrong with it, imo, just occassional satellite pixelated. 

Almost like there's an echo of what's just been said. It's not terrible, but annoying enough to make me stop and wait for another release. Like certain noises/sounds make a 'thwack' type sound. Turning the sound down to 62% in vlc player helps, but it's still there.

Still, thanks for the effort of upping this and re-upping it, maybe the third time around there'll be no audio issues? ;)
